import React, { useState } from 'react';


const Game =() =>
{
    const [count,setCount] = useState(50);
    
    const IncNum = ()=>
    
    {
        setCount(count+10);
        
//       console.log("clicked"+ count++);
    };
    
    return(
        <>
        <h1>{count}</h1>
        <button onClick={IncNum}>CLICK ME</button>
    
  </>
    
    
    );
};

export default Game;
